quite certain this represents the melding of entities. Fascinating.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005240,'One can learn volumes about a culture by studying its refuse.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005241,'Ugh. Matted clumps of hair, molted feathers, bits of bone, partially burned material - clothing perhaps?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005400,'We really should fix this fence soon.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005401,'*sigh* It\'s about time to check on the cemetary again-- Ill be back in a few minutes.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005402,'How long can it take to pick a handful of weeds?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005403,'At this rate I could have gathered them myself!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005404,'Ah, this must be him now... no? Bah!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005405,'As if I had all eternity.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005406,'We\'re running low on iron, lads! I don\'t want to see a single bar go to waste, ye hear me now?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005407,'Not bad. Try that trick I told you about when you temper the steel.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000000008,'What are you doing in Ysera\'s realm, interloper? Leave us, I say! Your kind are not welcome here!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000114,'What\'s the big idea, Spark? Why\'d you call for this meeting?',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000115,'Relax, Spark! I have it all under control. We\'ll strip mine the Exodar right out from under \'em - making both you and I very, very rich in the process.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000122,'Yes, sir. It won\'t happen again...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000123,'What\'s the big idea? You nearly blew my cover, idiot! I told you to put the compass and navigation maps somewhere safe - not out in the open for any fool to discover.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000248,'The Master has gone to great lengths to secure information about the whereabouts of the Exodar. You could have blown the entire operation, including the cover of our spy on the inside.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000292,'Relax? Do you know what Kael\'thas does to those that fail him, Geezle? Eternal suffering and pain... Do NOT screw this up, fool.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000293,'Our Bloodmyst scouts have located our contact. The fool, Velen, will soon leave himself open and defenseless -- long enough for us to strike! Now get out of my sight before I vaporize you...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000294,'You\'ve got my attention, dragon. You\'ll find I\'m not as easily scared as the villagers below.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000295,'You dare challenge me at my own dwelling? Your arrogance is astounding, even for a dragon!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000296,'I do not know what you speak of, dragon... but I will not be bullied by this display of insolence. I\'ll leave Karazhan when it suits me!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000297,'He should not have angered me. I must go... recover my strength now...',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000298,'Your dabbling in the arcane has gone too far, Medivh. You\'ve attracted the attention of powers beyond your understanding. You must leave Karazhan at once!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000299,'A dark power seeks to use you, Medivh! If you stay, dire days will follow. You must hurry, we don\'t have much time!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000300,'You leave me no alternative. I will stop you by force if you won\'t listen to reason!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000301,'What have you done, wizard? This cannot be! I\'m burning from... within!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000466,'%s smells the meat, awakens from his slumber, and roars in anger!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000060,'These tracks must belong to Shango.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000061,'These aren\'t Shango\'s tracks.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,''),(2000000004,'Everyone enjoying themselves so far?  That\'s great!  Welcome to the Darkmoon Faire, the greatest show on all of Azeroth!  Make sure that you speak with Yebb and his friends here while you\'re taking in Neblegear\'s Darkmoon Zoo Bizarre.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000000005,'We\'re back and better than ever!  It\'s the Darkmoon Faire friend, and it\'s your lucky day! Sparing no expense, we\'ve gathered wonders and treats from around the world for your delight.  Whether you\'re young or old, rich or poor, the Darkmoon Faire has it all!  Be sure to turn in your Darkmoon Faire Prize Tickets to Gelvas Grimegate, and choose from several exotic and wondrous prizes!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000000006,'Come one, come all.  Welcome to the Darkmoon Faire!  Don\'t be shy.  Step right up to Lhara and buy yourself an exotic artifact from far off lands.  If you\'re one of the lucky few who have found Darkmoon Cards, have a word with Professor Paleo.  Hungry?  Thirsty?  You\'re in luck!  Refreshments are available right here from Sylannia and Stamp.  I recommend the Darkmoon Special Reserve to wash down some Red Hot Wings.  And if the future is what you seek, then run, don\'t walk, to speak with Sayge.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000000007,'Welcome one and all to the Darkmoon Faire, the greatest event in all the world!  We have it all... delicious food, strong drink, exotic artifacts, fortunes read, amazing prizes and excitement without end!  Don\'t forget to turn in your Darkmoon Faire Prize Tickets to Gelvas Grimegate!  All it takes is five or more and you\'re on your way to the most wondrous prizes on all of Azeroth.  Everybody is a winner!',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),(2000005408,'Stonemasons. . .errr. . Defias be warned:  The rusty anchor sinks tonight.',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL);

/*Table structure for table `disables` */

DROP TABLE IF EXISTS `disables`;

CREATE TABLE `disables` (
  `sourceType` int(10) unsigned NOT NULL,
  `entry` int(10) unsigned NOT NULL,
  `flags` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `params_0` varchar(255) NOT NULL DEFAULT '',
  `params_1` varchar(255) NOT NULL DEFAULT '',
  `comment` varchar(255) CHARACTER SET utf8 NOT NULL DEFAULT '',
  PRIMARY KEY (`sourceType`,`entry`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `disables` */

/*Table structure for table `disenchant_loot_template` */

DROP TABLE IF EXISTS `disenchant_loot_template`;

CREATE TABLE `disenchant_loot_template` (
  `entry` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT 'Recommended id selection: item_level*100 + item_quality',
  `item` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `ChanceOrQuestChance` float NOT NULL DEFAULT '100',
  `lootmode` smallint(5) unsigned NOT NULL DEFAULT '1',
  `groupid` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `mincountOrRef` mediumint(9) NOT NULL DEFAULT '1',
  `maxcount` tinyint(3) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`entry`,`item`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED COMMENT='CTDB Loot System';

/*Data for the table `disenchant_loot_template` */

/*Table structure for table `event_scripts` */

DROP TABLE IF EXISTS `event_scripts`;

CREATE TABLE `event_scripts` (
  `id` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `delay` int(10) unsigned NOT NULL DEFAULT '0',
  `command` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `datalong` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `datalong2` int(10) unsigned NOT NULL DEFAULT '0',
  `dataint` int(11) NOT NULL DEFAULT '0',
  `x` float NOT NULL DEFAULT '0',
  `y` float NOT NULL DEFAULT '0',
  `z` float NOT NULL DEFAULT '0',
  `o` float NOT NULL DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `event_scripts` */

/*Table structure for table `exploration_basexp` */

DROP TABLE IF EXISTS `exploration_basexp`;

CREATE TABLE `exploration_basexp` (
  `level` tinyint(4) unsigned NOT NULL DEFAULT '0',
  `basexp` mediumint(9) NOT NULL DEFAULT '0',
  PRIMARY KEY (`level`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 ROW_FORMAT=FIXED COMMENT='Exploration System';

/*Data for the table `exploration_basexp` */

/*Table structure for table `fishing_loot_template` */

DROP TABLE IF EXISTS `fishing_loot_template`;

CREATE TABLE `fishing_loot_template` (
  `entry` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `item` mediumint(8) unsigned NOT NULL DEFAULT '0',
  `ChanceOrQuestChance` float NOT NULL DEFAULT '100',
  `lootmode` smallint(5) unsigned NOT NULL DEFAULT '1',
  `groupid` tinyint(3) unsigned NOT NULL DEFAULT '0',
  `mincountOrRef` mediumint(9) NOT NULL DEFAULT '1',
  `maxcount` tinyint(3) unsigned NOT NULL DEFAULT '1',
  PRIMARY KEY (`entry`,`item`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='Loot System';

/*Data for the table `fishing_loot_template` */

/*Table structure for table `game_event` */

DROP TABLE IF EXISTS `game_event`;

CREATE TABLE `game_event` (
  `EventEntry` mediumint(8) NOT NULL DEFAULT '0',
  `start_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Absolute start date, the event will never start before',
  `end_time` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT 'Absolute end date, the event will never start afler',
  `occurence` bigint(20) unsigned NOT NULL DEFAULT '5184000' COMMENT 'Delay in minutes between occurences of the event',
  `length` bigint(20) unsigned NOT NULL DEFAULT '2592000' COMMENT 'Length in minutes of the event',
  `holiday` mediumint(8) unsigned NOT NULL DEFAULT '0' COMMENT 'Client side holiday id',
  `description` varchar(255) DEFAULT NULL COMMENT 'Description of the event displayed in console',
  `world_event` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '0 if normal event, 1 if world event',
  PRIMARY KEY (`EventEntry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `game_event` */

/*Table structure for table `game_event_arena_seasons` */

DROP TABLE IF EXISTS `game_event_arena_seasons`;

CREATE TABLE `game_event_arena_seasons` (
  `eventEntry` tinyint(3) unsigned NOT NULL COMMENT 'Entry of the game event',
  `season` tinyint(3) unsigned NOT NULL COMMENT 'Arena season number',
  UNIQUE KEY `season` (`season`,`eventEntry`) USING BTREE
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `game_event_arena_seasons` */

/*Table structure for table `game_event_battleground_holiday` */

DROP TABLE IF EXISTS `game_event_battleground_holiday`;

CREATE TABLE `game_event_battleground_holiday` (
  `eventEntry` int(10) NOT NULL DEFAULT '0',
  `bgflag` int(10) unsigned NOT NULL DEFAULT '0',
  PRIMARY KEY (`eventEntry`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

/*Data for the table `game_event_battleground_holiday` */

/*Table structure for table `game_event_condition` */

DROP TABLE IF EXISTS `game_event_condition`;

CREATE TABLE `game_event_condition` (
